import React from 'react';
import {
    VictoryBar,
    VictoryChart,
    VictoryLine,
    VictoryPie,
  } from "victory";

const UserDetails = ({user}) => {


    return(
        <div className="graphs">
            <VictoryChart>
        <VictoryLine
          data={[
            { x: "Jan", y: 1234 },
            { x: "Feb", y: 2048 },
            { x: "Mar", y: 2600 },
            { x: "Apr", y: 9000 },
            { x: "May", y: 1234 },
            { x: "Jun", y: 2048 },
            { x: "Jul", y: 2600 },
            { x: "Aug", y: 9000 },
            { x: "Sep", y: 1234 },
            { x: "Oct", y: 2048 },
            { x: "Nov", y: 2600 },
            { x: "Dec", y: 9000 }
          ]}
        />
      </VictoryChart>
            <VictoryChart>
                <VictoryBar
                    data={[
                    { x: "lizard", y: 1234 },
                    { x: "snake", y: 2048 },
                    { x: "crocodile", y: 2600 },
                    { x: "alligator", y: 9000 },
                    ]}
                />
            </VictoryChart>
                <VictoryPie
                    data={[
                        { x: "lizard", y: 1234 },
                        { x: "snake", y: 2048 },
                        { x: "crocodile", y: 2600 },
                        { x: "alligator", y: 9000 },
                    ]}
                    />
        </div>
    )
}
export default UserDetails;
